import axios from "axios";
const { REACT_APP_API_URL } = process.env;

export default axios.create({
  baseURL: {REACT_APP_API_URL},
  headers: {
    "Content-type": "application/json;charset=utf-8",
    "Access-Control-Allow-Origin": "*"
  }
});
